import * as React from 'react';
import { View, Text, StyleSheet } from 'react-native';

export default function ListEditor({navigation}){
    return (
        <View>
            <Text>List Editor</Text>
        </View>
    );
}

const styles = StyleSheet.create({
    container:{
        padding:10,
        alignItems: 'center',
        justifyContent: 'center',
        
    }

});
